import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import LoginForm from './LoginForm';
import HomePage from './HomePage';

function App() {
    return (
        <Router>
            <Switch>
                <Route path="/login">
                    <LoginForm />
                </Route>
                <Route path="/home">
                    <HomePage />
                </Route>
            </Switch>
        </Router>
    );
}

export default App;
